import React from 'react';
import { Menu } from 'semantic-ui-react';

function NavTab({ currentPage, handlePageChange }) {
  // Define an array of navigation items
  const navItems = [
    { pageName: 'Home', label: 'Home' },
    { pageName: 'Attractions', label: 'Attractions' },
    { pageName: 'PlacesToGo', label: 'Places to Visit' },
    { pageName: 'Restaurants', label: 'Restaurants' },
    { pageName: 'Login', label: 'Login' },
    { pageName: 'SignUp', label: 'Sign Up' },
  ];

  return (
    <Menu pointing secondary>
      {navItems.map((item) => (
        <Menu.Item
          key={item.pageName}
          name={item.pageName}
          active={currentPage === item.pageName}
          onClick={() => handlePageChange(item.pageName)}
        >
          {item.label}
        </Menu.Item>
      ))}
    </Menu>
  );
}

export default NavTab;
